import ROUTES, { RenderRoutes } from './router/routes';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './components/Header'

function App() {
  return (
    <>
      <header>
        <Header />
      </header>
      <div>
        <RenderRoutes routes={ROUTES} />
      </div>
    </>
  );
}

export default App;
